module.exports = "<crud>\r\n\t<div text>\r\n\t\t<div class=\" col-lg-8 title-arrow\">\r\n\t\t\t<h1>Ditt Nollep</h1>\r\n\t\t</div>\r\n\t\t<br>\r\n\t\t<h5>Welcome to the student life at Campus Skellefte√•!</h5>\r\n\t\t<p><strong>Hello, congratulations and welcome!</strong></p>\r\n\t\t<p>We want to invite you to participate in what most definitely will become the\r\n\t\t\tbest two weeks you will experience during your time here at Campus Skellefte√•:\r\n\t\t\t<strong>Nolleperioden</strong>, a welcoming period for new students!</p>\r\n\t\t<p>Nolleperioden is an arrangement planned and performed by volunteering\r\n\t\t\tstudents, driven by commitment and a dream of giving you a welcoming as fun\r\n\t\t\tas they themselves had. Our Nolleperiod has one purpose and one purpose\r\n\t\t\tonly: to provide <strong>you</strong> - our new student - with the best start possible!</p>\r\n\t\t<p><strong>Ph√∂seriet</strong> is the group arranging Nolleperioden. In collaboration with the\r\n\t\t\tschools: LTU, Futuregames & Visual Magic, we‚Äôve planned two weeks filled with\r\n\t\t\tfun activities, teambuilding and events!</p>\r\n\t\t<p>The purpose with Nolleperioden is to give you an introduction and great\r\n\t\t\topportunity to: get to know and bond within your classmates, familiarize\r\n\t\t\tyourself with Campus & the city, get closer to other students, and of course to\r\n\t\t\tget an amazing and memorable start of your studies!</p>\r\n\t\t<br>\r\n\t\t<h5>To give you an idea of what it‚Äôs all about, here is some information:</h5>\r\n\t\t<ul style=\"list-style-type:disc\">\r\n\t\t\t<li>\r\n\t\t\t\t<strong>Nolleperioden</strong> is arranged yearly by <strong>Ph√∂seriet</strong>. Ph√∂seriet is a\r\n\t\t\t\tsubsection of the <strong>Student Union of Campus Skellefte√•</strong>. It consists of\r\n\t\t\t\ta group of volunteer students who put a lot of time and effort into\r\n\t\t\t\tgiving new students as good of a welcome as possible. Nolleperioden\r\n\t\t\t\tspans for about two weeks. During this period there will be games,\r\n\t\t\t\tcompetitions, concerts, spex, dinners and field trips where you will get\r\n\t\t\t\tto know your classmates but also people from other classes as well.\r\n\t\t\t</li>\r\n\t\t\t<br>\r\n\t\t\t<li>\r\n\t\t\t\t<strong>Ph√∂sare</strong> are the volunteering students working to help with the\r\n\t\t\t\tarrangements. They have during the year been educated in conflict\r\n\t\t\t\thandling, responsible handling of alcohol, leadership, and first aid.\r\n\t\t\t\tThey will help you take your first steps into student life and other fun\r\n\t\t\t\ttraditions\r\n\t\t\t</li>\r\n\t\t\t<br>\r\n\t\t\t<li>\r\n\t\t\t\t<strong>√ñverph√∂sare</strong> are the four students that have taken on the role of\r\n\t\t\t\torganizing Nolleperioden. They have planned what activities will be\r\n\t\t\t\theld, where to get funds, put together the training for the Ph√∂sare,\r\n\t\t\t\talong with arranging meetings to create unison within Ph√∂seriet and\r\n\t\t\t\tmaking sure that the Ph√∂sare are well prepared to lead you through\r\n\t\t\t\tthe event.\r\n\t\t\t</li>\r\n\t\t\t<br>\r\n\t\t\t<li>\r\n\t\t\t\tDuring Nolleperioden there will be an <strong>act</strong> ongoing throughout the\r\n\t\t\t\tentirety of Nolleperioden and it is <strong>completely voluntary</strong>. The act\r\n\t\t\t\tconsists of a sort of ‚Äúhierarchy‚Äù. At the top you have the all seeing and\r\n\t\t\t\tall knowing Adeln followed by √ñverph√∂sarna, their right hand men.\r\n\t\t\t\tBelow them are the Ph√∂sare (that continuously deals with the\r\n\t\t\t\tfathomless whims of √ñverph√∂sarna) and Nollor (lit. ‚Äòzeroes‚Äô the new\r\n\t\t\t\tstudents who have yet to begin their first year!). There are no actual\r\n\t\t\t\thierarchical differences between Ph√∂sare and Nollor except that the\r\n\t\t\t\tPh√∂sare have a responsibility to √ñverph√∂sarna whilst the Nollor are\r\n\t\t\t\tsimply there to have fun! If you don‚Äôt wish to participate in the act you\r\n\t\t\t\tdon‚Äôt have to, under the condition that you <strong><u>don‚Äôt spoil it for others.</u></strong>\r\n\t\t\t</li>\r\n        </ul> \r\n\t\t<p><strong><i>If the Nollor are not having fun then the Ph√∂sare aren‚Äôt having fun. If the Ph√∂sare\r\n\t\t\taren‚Äôt having fun, then the √ñverph√∂sare don‚Äôt have fun - and that‚Äôs no fun!</i></strong></p>\r\n\t\t<br>\r\n\t\t<h5>Tips for you, a new student</h5>\r\n\t\t<ul style=\"list-style-type:disc\">\r\n\t\t\t<li>\r\n\t\t\t\t<strong>Participate in Nolleperioden!</strong> It‚Äôs a wonderful experience where you\r\n\t\t\t\tmeet a lot of new friends. In addition, it serves as an excellent\r\n\t\t\t\ticebreaker for your entire studying period. ‚ÄúI remember once during\r\n\t\t\t\tmy Nolle-P (short for Nolleperioden) when...‚Äù\r\n\t\t\t</li>\r\n\t\t\t<br>\r\n\t\t\t<li>\r\n\t\t\t\t<strong>Throw away the stereotypes!</strong> Discard boring stereotypes about\r\n\t\t\t\twelcoming periodes being all about peer pressure, ridiculing students\r\n\t\t\t\tand alcohol. Here we make sure that Nolleperioden is inclusive and\r\n\t\t\t\tfun for everyone! Especially the new students!\r\n\t\t\t</li>\r\n\t\t\t<br>\r\n\t\t\t<li>\r\n\t\t\t\t<strong>Let yourself loose!</strong> Everyone thinks it‚Äôs fun when someone\r\n\t\t\t\tembarrasses themself. Therefore it will be much more enjoyable when\r\n\t\t\t\teveryone does it all the time.\r\n\t\t\t</li>\r\n\t\t\t<br>\r\n\t\t\t<li>\r\n\t\t\t\t<strong>The student pub!</strong> Traversen is open almost every night. Traversen is\r\n\t\t\t\ta fantastic and cozy pub, also driven by students, located under the\r\n\t\t\t\tCafeteria. Traversen offers a wide range of drinks, beverages, great\r\n\t\t\t\tnon-alcoholic alternatives & some variety of snacks & food. You can\r\n\t\t\t\thowever <strong>not</strong> pay with a card at Traversen - cash only!\r\n\t\t\t\t<strong>NOTE:</strong> Activities during Nolleperioden & entrance to Traversen are\r\n\t\t\t\t<strong>FREE</strong>.\r\n\t\t\t</li>\r\n\t\t\t<li>\r\n\t\t\t\t<strong>Respect the act.</strong> It‚Äôs fun, and it becomes much more fun if everyone‚Äôs in on it.\r\n\t\t\t\tEven if you feel like it‚Äôs not what floats your boat - remember to respect\r\n\t\t\t\tothers' wishes to join in.\r\n\t\t\t</li>\r\n        </ul> \r\n\t</div>\r\n</crud>"

